import React from 'react'
import { Button, Icon, Input, Dropdown, Menu, Switch } from 'antd'

export default function({
  shuffle,
  search,
  setColumns,
  setMargin,
  setHeight,
  columns,
  margin
}) {
  return (
    <div className="header">
      <Button type="primary" onClick={shuffle}>
        Add Article
      </Button>
      <div><h1>The Express Times</h1></div>

    </div>
  )
}
